var stickyNavTop = jQuery('.top_header').offset().top ;  
var stickyNav = function(){  
var scrollTop = jQuery(window).scrollTop();  

if (scrollTop > stickyNavTop) {   
	jQuery('#mainSkinWrapper').addClass('sticky_mainSkinWrapper');


} else {  

	jQuery('#mainSkinWrapper').removeClass('sticky_mainSkinWrapper');


}  
};
stickyNav();  
jQuery(window).scroll(function() {  
    stickyNav();  
});  
});

